import React, { useState } from 'react';
import './ExpensesForm';
import './NewExpenses';
import NewExpenses from './NewExpenses';
import ExpensesForm from './ExpensesForm';

function OpenForm(props) {
	const [btnClose, setButtonClose] = useState(false);
	const [btnOpen, setButtonOpen] = useState(false);

	const btnOpenHandler = () => {
		setButtonOpen(true);
	};

	const closeFormHandler = () => {
		setButtonClose(true);
	};

	<div>
		<NewExpenses
			btnClose={btnClose}
			setButtonClose={setButtonClose}
			btnOpen={btnOpen}
			setButtonOpen={setButtonOpen}
			btnOpenHandler={btnOpenHandler}
			closeFormHandler={closeFormHandler}
		/>
		<ExpensesForm
			btnClose={btnClose}
			setButtonClose={setButtonClose}
			btnOpen={btnOpen}
			setButtonOpen={setButtonOpen}
			btnOpenHandler={btnOpenHandler}
			closeFormHandler={closeFormHandler}
		/>
	</div>;
}

export default OpenForm;
